import React, {Component} from "react"
class Filmovi extends Component{
    
    constructor(){
        super()
        this.state = {
            filmovi: []
        }
    }
    
    componentDidMount(){
        let headers=new Headers();

        headers.append('Content-Type', 'application/json');
        headers.append('Accept', 'application/json');
        headers.append('Origin','http://localhost:8080/bioskop/filmovi');

        fetch({
                        method: 'GET',
                        headers: {
                                    'Content-Type': 'application/json',
                                    'API-Key': 'secret'
                                    }
        })
        .then(response => response.json())
        .then(response => {
            const {data} = response.data
            console.log("Podaci: "+data)
            this.setState({
                filmovi: data
            })
        })
    }

    render(){
        const prikaz=(this.state.filmovi.length === 0) ? <h1>Nema jos ni jednog filma</h1>:<h1>Ima filmova</h1>
        return(
            prikaz
        )
    }

}

function PrikazFilmova(props){
